import React from 'react'
import HomeExercicios from './HomeExercicios'

const Exercicio2 =  (posts) => {


  return (
    <div>
      <HomeExercicios.props.posts/>
      {posts.props.map((item) => (
        <div key={item}>
          <div>{item.id}</div>
          <div>{item.title}</div>
          <div>{item.content}</div>
        </div>
      ))
      }
    </div>
  )
}

export default Exercicio2
